import React from 'react';
import Button from 'react-bootstrap/esm/Button';
import Form from 'react-bootstrap/Form';
const container ={
    display: "flex",
    flexDirection: "row",
    justifyContent: "space-around"
}
const AddVolunteer = () => {
    // <Form>
    //     <Form.Group>
    //         <Form.Label>Description on your group</Form.Label>
    //         <Form.Control as="textarea" rows={3} id="description" name="description"
    //             onChange={formik.handleChange} value={formik.values.description} disabled={isCreate} />
    //     </Form.Group>
    // </Form>

    return (<div className="auth-wrapper">
    <div className="auth-inner">
        <h3>Add Volunteer</h3><br/>
        <form>

            {(() => {
                const inputs = [];
                for (let i = 0; i < 5; i++) {
                    inputs.push(<><div className="container" style={container}>
                         <input type="text" placeholder="name"/>
                        <input type="email" placeholder="email"/>
                        <input type="submit" value="Add" /></div><br/></>);
                }
                return inputs;
            })()}
            <Button>Add all</Button>
            <Button>Upload from xl file</Button>
        </form></div></div>
    );
}
export default AddVolunteer;
